import React from "react";

const Dropdown = () => {

    const stuffList = [
        'Climatisation',
        'Wi-Fi',
        'Cuisine',
        'Espace de travail',
        'Fer à repasser',
        'Sèche-cheveux',
        'Cintres'
    ]

  return (
    <div className="dropdownAbout">
      <div className="dropdownAbout__top">
        <h3>Fiabilité</h3>
        <img src="/arrow-dropdown.png" alt="icon dropdown" />
      </div>
      <div className="dropdownAbout__bot">
        <ul>
            {stuffList.map((stuff) => (
                <li>{stuffList}</li>
            ))}
        </ul>
      </div>
    </div>
  );
};

export default Dropdown;
